%[text] %[text:anchor:H_75cb] ## Problem 1: Rotation Matrix \[5 pts\]
%[text] %[text:anchor:H_6dcd] #### 1a) \[1 pt\] Properties of a rotation matrix
%[text] If we view the rotation matrix $R = \[r\_1, r\_2\] \\in SO(2)$ as a matrix with 2 column vectors, write down the 3 properties of the rotation matrix
%[text] 
%[text] $\\textbf{Properties of a rotation matrix:} \\\\\n\n1.\\; R^\\top R = I  \\\\\n\n2.\\; \\det(R) = 1 \\\\\n\n3.\\; r\_1^\\top r\_2 = 0, \\quad \\|r\_1\\| = \\|r\_2\\| = 1\n$
%[text] %[text:anchor:H_0f7c] #### 1b) \[1 pt\] Proof: Prove that $R^{-1} = R^\\top$
%[text] 
%[text] $\\textbf{Proof:} \\\\\nR^\\top R = I \\\\ \n\\text{Left multiply both sides by } R^{-1}\n\\\[\nR^{-1} R^\\top R = R^{-1} I \\Rightarrow R^{-1} = R^\\top\n\\\]\n\n$
%[text] %[text:anchor:H_86ef] #### 1c) \[3 pts\] Prove the equation below:
%[text] $\\widehat{R\\omega}=R\\hat{\\omega}R^\\top$
%[text]  where $\\omega $ is the angular velocity
%[text] Hint\*: the following distribution law holds:
%[text] $R(a \\times b) = (Ra)\\times (Rb)$
%[text] 
%[text] $\\textbf{Proof:}\n\n\\\[\n\\widehat{R\\omega} x = (R\\omega) \\times x = (R\\omega) \\times (RR^\\top x)  =  R \\bigl( \\omega \\times (R^\\top x) \\bigr)\n= R \\widehat{\\omega} (R^\\top x)\n= (R \\widehat{\\omega} R^\\top) x\n\\\]\n\nFor any &dollar&;x&dollar&;, we conclude:\n\\\[\n\\widehat{R\\omega} = R \\widehat{\\omega} R^\\top\n\\\]\n$
%%
%[text] %[text:anchor:H_144d] ## Problem 2: Analytic Inverse Kinematics \[3 pts\]
%[text] %[text:anchor:H_4fa6] #### 2a) \[2 pts\] For the 2-link robot, derive the inverse kinematics
%[text] express $q\_1, q\_2$ using $l\_1, l\_2, x, y$
%[text] %[text:anchor:H_4965] #### ![2R_robot.png](text:image:5970)
%[text] 
%[text] $\n\nx = l\_1cosq\_1+l\_2cos(q\_1+q\_2) \\\\\ny = l\_1sinq\_1+l\_2sin(q\_1+q\_2) \\\\\nr^2 = x^2 + y^2 \\\\\nc\_2 = \\frac{r^2 - l\_1^2 - l\_2^2}{2 l\_1 l\_2}\\\\ \ns\_2 = \\pm \\sqrt{1-c\_2^2} \\\\\n\nq\_2 = {arctan}(s\_2,\\,c\_2) \\\\\n\nq\_1 = {arctan}(y,\\,x) \\;-\\;\n      {arctan}\\!\\big(l\_2 s\_2,\\; l\_1 + l\_2 c\_2\\big)\n$
%[text] %[text:anchor:H_2e44] #### 
%[text] %[text:anchor:H_0784] #### 2b) \[1 pt\] What are the set of $q$ that correspond to singularities?
%[text] 
%[text] %[text:anchor:H_8a3b] #### ${\\; \\mathcal{S} = \\{\\, q \\in \\mathbb{R}^2 \\mid q\_2 = 0 \\ \\text{or}\\ q\_2 = \\pi \\} }\n$
