%[text] ## Problem 3 - Forward Kinematics (FK) \[7 pts\]
%[text] #### 3a) \[2 pts\] Derive the analytic FK of the inverted leg via Homogeneous Transformation Matrices.
%[text] Assume the configuration with all zero joint position (home configuration) is when both links are pointing vertically up
pos_ee_gt = [ %[output:group:182912ce] %[output:133d0ae1]
    cos(q1) * (l3 * sin(q2 + q3) + l2 * sin(q2)); %[output:133d0ae1]
    sin(q1) * (l3 * sin(q2 + q3) + l2 * sin(q2));     %[output:133d0ae1]
    l1 + l3 * cos(q2 + q3) + l2 * cos(q2) %[output:133d0ae1]
] %[output:group:182912ce] %[output:133d0ae1]
pos_ee_htm = []; % (3, 1) analyitical expression of end-effector position derived from HTM
%%% YOUR CODE START %%%
Rz_q1 = [cos(q1) -sin(q1) 0;
         sin(q1)  cos(q1) 0;
         0        0       1];

Ry_q2 = [cos(q2)  0  sin(q2);
         0        1  0;
        -sin(q2)  0  cos(q2)];

Ry_q3 = [cos(q3)  0  sin(q3);
         0        1  0;
        -sin(q3)  0  cos(q3)];

T01 = [Rz_q1 [0;0;l1]; 0 0 0 1];
T12 = [Ry_q2 [0;0;0];   0 0 0 1];
T23 = [Ry_q3 [0;0;l2];  0 0 0 1];
T3E = [eye(3) [0;0;l3]; 0 0 0 1];

T0E = simplify(T01 * T12 * T23 * T3E);

pos_ee_htm = simplify(T0E(1:3,4));

%%% YOUR CODE END %%%

assert(isequaln(pos_ee_gt, simplify(expand(pos_ee_htm))), "FK didn't match!")
%[text] %[text:anchor:H_4bcd] #### 
%[text] %[text:anchor:H_2501] #### 3b) \[1 pt\] Compute the EE postiion at configuration ${{q}} = \[1, 0.8, 0.5\]^T$
%[text] Note: use the $subs$ function: [https://www.mathworks.com/help/symbolic/sym.subs.html](https://www.mathworks.com/help/symbolic/sym.subs.html) 
pos_ee_val = zeros(3, 1); % (3, 1) numerical values of end-effector position
q_val = [1, 0.8, 0.5]';
l_val = [0.08, 0.3, 0.25]';
%%% YOUR CODE START %%%

pos_ee_val = double(subs(pos_ee_htm, ...
    {q1, q2, q3, l1, l2, l3}, ...
    {q_val(1), q_val(2), q_val(3), l_val(1), l_val(2), l_val(3)}));

%%% YOUR CODE END %%%
assert(norm(pos_ee_val - [0.2464    0.3838    0.3559]')<1e-3, 'EE position error!')

% visualize the robot
showmotion(robot, [1, 2], [q_val, zeros(3, 1)]) %[output:0e580a28]
%[text] %[text:anchor:H_7495] #### 3c) \[2 pts\] Compute the EE velocity at configuration ${{q}} = \[1, 0.8, 0.5\]^T$and $\\dot{q}=\[0.2, 0.5, 1\]$
%[text] Note: compute Jacobian and use $v= J\\dot{q}$
vel_ee_val = zeros(3, 1); % (3, 1) numerical value of end-effector velocity
q_val = [1, 0.8, 0.5]';
dq_val = [0.2, 0.5, 1]';
%%% YOUR CODE START %%%

J = jacobian(pos_ee_htm, [q1 q2 q3]);

J_val = double(subs(J, {q1, q2, q3, l1, l2, l3}, ...
    {q_val(1), q_val(2), q_val(3), 0.08, 0.3, 0.25}));

vel_ee_val = J_val * dq_val;

%%% YOUR CODE END %%%
assert(norm(vel_ee_val - [0.0339	0.2216	-0.4689]')<1e-3, 'EE velocity error!')
%[text] #### 3d) \[1 pt\] Outout Matlab functions
%[text] Output EE position, velocity, Jacobian as separte matlab functions
%[text] Note: use the $matlabFunction$ function: [https://www.mathworks.com/help/symbolic/sym.matlabfunction.html](https://www.mathworks.com/help/symbolic/sym.matlabfunction.html) 
%[text] As an example, the way to generate matlab function for EE position is:
matlabFunction(pos_ee_htm, 'File', 'fcn_pos_ee.m', 'Vars', {q, l}) %[output:5a3f8422]
%%% YOUR CODE START %%%

matlabFunction(pos_ee_htm, ...
    'File', 'fcn_pos_ee.m', ...
    'Vars', {q, l});

J = jacobian(pos_ee_htm, q);
matlabFunction(J, ...
    'File', 'fcn_jacobian_ee.m', ...
    'Vars', {q, l});

vel_ee_sym = J * dq;
matlabFunction(vel_ee_sym, ...
    'File', 'fcn_vel_ee.m', ...
    'Vars', {q, dq, l});

%%% YOUR CODE END %%%
%[text] %[text:anchor:H_72e6] #### 3e) \[1 pt\] evaluate matlab functions for EE position, velocity and Jacobian
%[text] As an example, the way to compute EE position is:
pos_ee_val_m = fcn_pos_ee(q_val, l_val) %[output:6b4c7a36]
%%% YOUR CODE START %%%

vel_ee_val_m = fcn_vel_ee(q_val, dq_val, l_val);
J_val_m = fcn_jacobian_ee(q_val, l_val);

%%% YOUR CODE END %%%
%[text] ## Problem 4 - Numerical Inverse Kinematics (IK) \[3 pts\]
%[text] #### 4a) \[2 pts\] Use nonlienar least square to solve the IK numerically.
%[text] Note: use the function $lsqnonlin$: [https://www.mathworks.com/help/optim/ug/lsqnonlin.html\#buuhcjf-2](https://www.mathworks.com/help/optim/ug/lsqnonlin.html#buuhcjf-2) 
pos_ee_des = [0.3; 0.3; 0.3];
q_guess = [0; 0; 0];
q_sol = []; % (3, 1) solved joint positions
%%% YOUR CODE START %%%

ik_error_fun = @(q) fcn_pos_ee(q, l_val) - pos_ee_des;
opts = optimoptions('lsqnonlin', 'Display', 'off');
q_sol = lsqnonlin(ik_error_fun, q_guess, [], [], opts);

%%% YOUR CODE END %%%

pos_ee_calc = fcn_pos_ee(q_sol, l_val) %[output:2ce43457]
error = norm(pos_ee_calc - pos_ee_des);
assert(error < 1e-3, 'IK solution error!')
%[text] %[text:anchor:H_758c] #### 4b) \[1 pt\] Solve for joint space trajectory from task space trajectory
%[text] Given a task space trajectory, solve for the corresponding joint trajectories.
%[text] The test case is generated with all zero initial guesses, but a good practice is to use the previous solution as the next initial guess. Both solutions are acceptable for this assignment. 
%[text] Hint: you can visualize the solved trajectory by running the following in **terminal**.
%[text] `close all force`
%[text] `showmotion(robot, linspace(0, 1, Nt), q_traj)`
Nt = 11;
t = linspace(0,2*pi,Nt);
pos_ee_traj = [0.3 + 0.1 * cos(t); 
               0.3 + 0.1 * sin(t); 
               0.3 * ones(1,Nt)];

q_traj = zeros(3, Nt); % (3, Nt) Solved joint trajectory
ops = optimoptions(@lsqnonlin,'Display','off');
%%% YOUR CODE START %%%

q_guess = [0; 0; 0];

for i = 1:Nt
    pos_des = pos_ee_traj(:, i);                   
    ik_error_fun = @(q) fcn_pos_ee(q, l_val) - pos_des;

    if i > 1
        q_guess = q_traj(:, i-1);
    end

    q_sol = lsqnonlin(ik_error_fun, q_guess, [], [], ops);

    q_traj(:, i) = q_sol; 
    q_guess = q_sol;    
end

%%% YOUR CODE END %%%

q_traj_gt = ...
    [0.6435, 0.7555, 0.8736, 0.9729, 1.0226, 0.9828, 0.8334, 0.6508, 0.5544, 0.5645, 0.6435;
    1.0497, 1.1728, 1.1672, 0.8709, 0.6095, 0.4005, 0.2880, 0.3277, 0.4970, 0.7336, 1.0497;
    0.2346, 0.0001, 0.0002, 0.5926, 1.0654, 1.3973, 1.5569, 1.5021, 1.2494, 0.8484, 0.2346];
error = norm(q_traj - q_traj_gt);
assert(error < 1.5e-4, 'joint trajectory solution error!')


%[text] %[text:anchor:H_254d] ## Problem 5 - Eulerâ€“Lagrange Dynamics \[7 pts\]
%[text] #### 5a) \[2 pts\] Compute the linear velocities of the center of mass (CoM) at each link
%[text] Assume the center of mass for each link is in the middle.
%%% YOUR CODE START %%%

Rz1 = [cos(q1) -sin(q1) 0;
       sin(q1)  cos(q1) 0;
       0        0       1];
Ry2 = [cos(q2) 0 sin(q2);
       0       1 0;
      -sin(q2) 0 cos(q2)];
Ry3 = [cos(q3) 0 sin(q3);
       0       1 0;
      -sin(q3) 0 cos(q3)];


T01 = [Rz1 [0;0;l1]; 0 0 0 1];
T12 = [Ry2 [0;0;0];  0 0 0 1];
T23 = [Ry3 [0;0;l2]; 0 0 0 1];
T3C = [eye(3) [0;0;l3/2]; 0 0 0 1]; 
T2C = [eye(3) [0;0;l2/2]; 0 0 0 1]; 
T1C = [eye(3) [0;0;l1/2]; 0 0 0 1];

p1c = (T01*T1C)*( [0;0;0;1] );          
p2c = (T01*T12*T2C)*( [0;0;0;1] );      
p3c = (T01*T12*T23*T3C)*( [0;0;0;1] );  

Jv1 = jacobian(p1c(1:3), [q1 q2 q3]);
Jv2 = jacobian(p2c(1:3), [q1 q2 q3]);
Jv3 = jacobian(p3c(1:3), [q1 q2 q3]);

v1_c = simplify( Jv1 * [dq1; dq2; dq3] );
v2_c = simplify( Jv2 * [dq1; dq2; dq3] );
v3_c = simplify( Jv3 * [dq1; dq2; dq3] );


v_com_world = [v1_c, v2_c, v3_c];

%% YOUR CODE END %%%
%[text] %[text:anchor:H_9af4] #### 5b) \[1 pt\] Compute the angular velocities of each link expressed in the corresponding body frame
%[text] Hint: compute angular velocities via stacking and angular velocities of all preceding axes
%%% YOUR CODE START %%%

z1_world = [0;0;1];                
y2_world = Rz1*[0;1;0];             
y3_world = (Rz1*Ry2)*[0;1;0];  

w1_world = dq1*z1_world;
w2_world = w1_world + dq2*y2_world;
w3_world = w2_world + dq3*y3_world;

R01 = Rz1;
R02 = Rz1*Ry2;
R03 = Rz1*Ry2*Ry3;

w1_body = simplify( R01.' * w1_world );
w2_body = simplify( R02.' * w2_world );
w3_body = simplify( R03.' * w3_world );


w_body = [w1_body, w2_body, w3_body];  

%% YOUR CODE END %%%
%[text] %[text:anchor:H_583d] #### 5c) \[2 pts\] Compute the kinetic energy and potential energy
N = 3;
M = {};  % link mass
I = {};  % link inertia matrix in body frame
% Retrive mass and inertia for each link
for idx = 1:N
    [mass, ~, inertia] = mcI(robot.I{idx});
    M{idx} = mass;
    I{idx} = inertia;
end

%%% YOUR CODE START %%%

syms g real
T = 0;   % kinetic energy
V = 0;   % potential energy

for i = 1:N
    m = M{i};           
    Ic = I{i};        

    vi = v_com_world(:,i); 
    T = T + 0.5*m*(vi.'*vi);

    wi = w_body(:,i);    
    T = T + 0.5*(wi.'*Ic*wi);

    pi = eval(['p' num2str(i) 'c']);  
    V = V + m*g*pi(3);                
end

T = simplify(T);
V = simplify(V);

%%% YOUR CODE END %%%
%[text] %[text:anchor:H_4fa7] #### 5d) \[1 pt\] Compute the mass matrix
H = []; % (3, 3) mass matrix
%%% YOUR CODE START %%%

L = T - V;
q = [q1; q2; q3];
H = sym(zeros(3,3));

for i = 1:3
    for j = 1:3
        H(i,j) = diff(diff(T, dq(i)), dq(j));  
    end
end

H = simplify(H);

%% YOUR CODE END %%%

q_val = [0; 0; 0];
dq_val = [0; 0; 0];
[H_gt, bias_gt] = HandC(robot, q_val, dq_val);

H_val = double(subs(H, [q, l], [q_val, l_val]));

error_H = norm(H_val - H_gt) %[output:1c31bfad]
assert(error_H < 1e-7, "Mass matrix error!")
%[text] %[text:anchor:H_528a] #### 5e) \[1 pt\] Compute the gravitational vector
G = []; % (3, 1) generized gravity
%%% YOUR CODE START %%%

q = [q1; q2; q3];
for i = 1:3
    G(i) = diff(V, q(i)); 
end
G = simplify(G);

%%% YOUR CODE END %%%
%%
%[text] ## Helper Functions
function R = rot(th, a)
    % Create coordinate rotation matrix
    c = cos(th);
    s = sin(th);
    if a == 'x'
        R = [ 1  0  0;
              0  c  -s;
              0  s  c];
    elseif a == 'y'
        R = [ c  0  s;
              0  1  0;
             -s  0  c];
    elseif a == 'z'
        R = [ c -s  0;
              s  c  0;
              0  0  1];
    else
        disp('specify rotation axis\n')
    end
end

